css:
@-moz-document domain(osu.ppy.sh) {
   .profileGameModes .active {
    background-color: rgb(231, 151, 198);
    color: rgba(0, 0, 0, 0.7)!important;
}
.bodytopbg,
div.header.clickable-cell,
.bmlist-options > a,
.icon-comments {
    background: rgb(25, 25, 25);
}
element.style {
    background-image: none!important;
}
.sf-menu a,
.sf-menu a:visited {
    color: #FFC5E8;
}
.userpage-expand:hover {
    background: rgba(231, 151, 198, 0.76);
    cursor: pointer;
}
.userpage-expand {
    margin-top: 0px;
    position: relative;
    background: #E797C6;
    width: 100%;
    text-align: center;
}
.profileStatHeader {
    background: rgb(38, 38, 38);
    border-bottom: 1px solid #E797C6;
    color: #FFC5E8;
    font-weight: bold;
    font-size: 140%;
    margin-bottom: 6px;
    margin-top: 14px;
}
a:hover {
    color: rgb(248, 214, 240);
    text-decoration: underline;
}
a {
    color: #FFC5E8;
    text-decoration: none;
    cursor: pointer;
}
body,
textarea,
input,
textarea:focus,
input:focus {
    color: #FFB8C0;
}
.dialog-area,
.peppynote,
.reasonpanels > li,
.reasonpanels > li:hover > i,
.changelog-text,
.row1p,
li.sfHover > ul > li > a,
.login-dropdown,
.blurb,
.news-text,
.row1,
.postRight,
.postbody,
.postTime,
.tablebgside > tbody > tr > td,
.quotecontent,
.sectionContents,
.playstyle-container {
    background: rgb(63, 63, 63)
}
.profileStatLine {
    background: #262626;
    border-bottom: 1px dashed #EC55BC;
    font-size: 130%;
    margin-bottom: 3px;
}
.bodytopbg {
    background-image: url("http://imgur.com/SsUz1If") !important;
    background-size: cover!important;
    background-position: 50%!important;
    background-repeat: no-repeat!important;
    background-attachment: fixed!important;
}
}
